import React from "react";

export default function TotalBalances() {
  return (
    <div className="dashboard-column text-center">
      <p className="text-2x1 font-bold uppercase tracking-wide text-white-100">TOTAL BALANCE</p>
      <p className="text-2xl font-bold mt-2">$26,563.78</p>
    </div>
  );
}
